-- bare table with no attribute columns
CREATE TABLE base_bare_t (cartodb_id integer, the_geom geometry, the_geom_webmercator geometry);
-- table with attributes
CREATE TABLE base_t (cartodb_id integer, the_geom geometry, the_geom_webmercator geometry, number double precision, int_number integer, name text, start date);
-- polygons table
CREATE TABLE polyg_t (cartodb_id integer, name text, the_geom geometry, the_geom_webmercator geometry);

CREATE TABLE column_types_t
AS SELECT cartodb_id,
          the_geom,
          the_geom_webmercator,
          (CASE cartodb_id % 2 WHEN 0 THEN 'f' ELSE 't' END)::boolean AS is_odd
FROM base_bare_t;
